import React, { useRef, useState } from 'react';
import './book.css';

const BookingForm = () => {


    var a = useRef();


    const handleSubmit = (j) => {

        j.preventDefault();

        axios.post("http://localhost:1000/servicebook").then(function(response){

        })

    };

    return (
        <div className="booking-container">
            <h2>Book your Service</h2>
            <form onSubmit={handleSubmit} className="booking-form"> 
                <input type="text" required name="name" placeholder="Your Name" required ref={a}/>
                <input type="email" required name="email" placeholder="Your Email" required ref={a}/>
                <select name="service" required ref={a}>
                    <option value="">Select a Service</option>
                    <option value="cleaning">engine diagnostics</option>
                    <option value="plumbing">oil and filters</option>
                    <option value="electrician">brake repair</option>
                    <option value="electrician">wheel alignment</option>
                    <option value="electrician">general service</option>
                    <option value="electrician">bettry checking</option>    
                </select>
                <input type="date" name="date" required />
                <input type="time" name="time" required />
                <textarea name="message" placeholder="Additional Notes" ></textarea>
                <button type="submit">Submit Booking</button>
            </form>
        </div>
    );
};

export default BookingForm;
